const http = require('http');
const fs = require('fs');
const path = require('path');

const server = http.createServer((req, res) => {
  const filePath = path.join(__dirname, req.url);
  const ext = path.extname(filePath);

  if (ext === '.custom-file-type') {
    fs.readFile(filePath, (err, data) => {
      if (err) {
        res.writeHead(404, { 'Content-Type': 'text/plain' });
        res.end('File not found');
      } else {
        res.writeHead(200, { 'Content-Type': 'custom/filetype' });
        res.end(data);
      }
    });
  } else {
    // Handle other file types or routes
  }
});

server.listen(3000, () => {
  console.log('Server listening on port 3000');
});

const express = require('express');
const fs = require('fs');
const path = require('path');

const app = express();

app.use((req, res, next) => {
  const filePath = path.join(__dirname, req.url);
  const ext = path.extname(filePath);

  if (ext === '.testext') {
    fs.readFile(filePath, (err, data) => {
      if (err) {
        res.status(404).type('text/plain').send('File not found');
      } else {
        res.status(200).type('your-custom-mime-type').send(data);
      }
    });
  } else {
    next();
  }
});

app.listen(3000, () => {
  console.log('Server listening on port 3000');
});

import argparse
import threading
import requests

class LoadTester:
    def init(self, url, payload):
        self.url = url
        self.payload = payload
        self.request_counter = 0
        self.printed_msgs = []
        self.lock = threading.Lock()
        self.threads = 500  # Default number of threads

    def print_msg(self, msg):
        with self.lock:
            if msg not in self.printed_msgs:
                print(f"\n{msg} after {self.request_counter} requests")
                self.printed_msgs.append(msg)

    def handle_status_codes(self, status_code):
        with self.lock:
            self.request_counter += 1
        print(f"\r{self.request_counter} requests have been sent", end="")

        if status_code == 429:
            self.print_msg("You have been throttled")
        elif status_code == 500:
            self.print_msg("Status code 500 received")

    def send_get(self):
        while True:
            try:
                response = requests.get(self.url)
                self.handle_status_codes(response.status_code)
            except requests.RequestException:
                pass

    def send_post(self):
        while True:
            try:
                response = requests.post(self.url, data=self.payload)
                self.handle_status_codes(response.status_code)
            except requests.RequestException:
                pass

    def start(self):
        threads = []
        for _ in range(self.threads):
            if self.url:
                if self.payload:
                    thread = threading.Thread(target=self.send_post)
                else:
                    thread = threading.Thread(target=self.send_get)
                threads.append(thread)
                thread.start()

        for thread in threads:
            thread.join()  # Note: This will make the main thread wait indefinitely

if name == "main":
