public class Fecha {

    //ATRIBUTOS
    private byte dia, mes;
    private short anyo;

    //CONSTRUCTORES
    public Fecha(byte mes) {
        this.mes = mes;
    }

    public Fecha(byte dia, byte mes, short anyo) {
        this.anyo = anyo;
        this.mes = mes;
        this.dia = dia;
    }

    //GETTERS & SETTERS
    public byte getDia() {
        return dia;
    }

    public void setDia(byte dia) {
        this.dia = dia;
    }

    public byte getMes() {
        return mes;
    }

    public void setMes(byte mes) {
        this.mes = mes;
    }

    public short getAnyo() {
        return anyo;
    }

    public void setAnyo(short anyo) {
        this.anyo = anyo;
    }

    //MÉTODOS
    //Comprueba si una fecha está dentro del Verano o nó.
    public boolean esVerano() {
        return (mes == 6 && dia >= 21) || (mes == 7) || (mes == 8 && dia <= 23);
    }

    //Devuelve el objeto Fecha formateado como solicita el ejercicio, tipo ISO 8601
    public String fechaToString() {
        return "La fecha es: " + dia + "/" + mes + "/" + anyo;
    }

    //Devuelve el objeto Fecha formateado como sigue YY/MM/DD, tipo ISO 8601
    public String fechaToISO() {
        LocalDate fechaISO = LocalDate.of(anyo, mes, dia);
        DateTimeFormatter formatoPersonalizado = DateTimeFormatter.ofPattern("yyyy/MM/dd");
        return "La fecha en formato ISO 8601 es: " + fechaISO.format(formatoPersonalizado);
    }
    
    //Para modificar un objeto solicitando entrada por teclado al usuario, día mes y año.
    public void modificaFecha(){
        try(Scanner scan= new Scanner(System.in)){
        
        System.out.println("Introduce el día (1-31): ");
        byte nuevodia = scan.nextByte();
        setDia(nuevodia);

        System.out.println("Introduce el mes (1-12): ");
        byte nuevomes = scan.nextByte();
        setMes(nuevomes);

        System.out.println("Introduce el año: ");
        short nuevoanyo = scan.nextShort();
        setAnyo(nuevoanyo);
        }catch(Exception e) {
        e.printStackTrace(); // Manejo básico de excepciones para depuración
        }
    }
    
}

