// Function to add a product to the inventory
void addProduct(vector<Product>& inventory, const string& name, double price, int quantity) {
    Product newProduct = {name, price, quantity};
    inventory.push_back(newProduct);
}

// Function to display the current inventory
void displayInventory(const vector<Product>& inventory) {
    horizontalLine(120, '*', "I N V E N T O R Y");  // Display inventory header
    horizontalLine(120, '*');
    cout << left << setw(35) << "PRODUCT NAME" << right << setw(32) <<"PRICE" << setw(35) << "QTY\n";
    for (const Product& product : inventory) {
        cout << left << setw(35) << product.name << right << setw(30) << "Php " << product.price << setw(30) << product.quantity << " Piece/s\n";
    }
    horizontalLine(120, '*');
}

// Function to add a product to the shopping cart
void addToCart(vector<Product>& inventory, vector<Product>& cart, const string& productName, int quantity) {
    string lowerProductName = productName;
    transform(lowerProductName.begin(), lowerProductName.end(), lowerProductName.begin(), ::tolower);

    // Find the product in the inventory
    auto productIt = find_if(inventory.begin(), inventory.end(),
                             [&lowerProductName](const Product& product) {
                                 string lowerProduct = product.name;
                                 transform(lowerProduct.begin(), lowerProduct.end(), lowerProduct.begin(), ::tolower);
                                 return lowerProduct == lowerProductName;
                             });

    // If the product is found and there is enough quantity, add it to the cart
    if (productIt != inventory.end() && productIt->quantity >= quantity) {
        cart.push_back({productIt->name, productIt->price, quantity});
        productIt->quantity -= quantity;
        cout << quantity << " " << productIt->name << "(s) added to cart.\n";
    } else {
        cout << "Product not found or insufficient quantity.\n";
    }
}

// Function to display the contents of the shopping cart
void displayCart(const vector<Product>& cart) {
    horizontalLine(120, '*', "Y O U R  C A R T");  // Display cart header
    horizontalLine(120, '*');
    cout << left << setw(35) << "PRODUCT NAME" << right << setw(32) <<"PRICE" << setw(35) << "QTY\n";
    for (const Product& product : cart) {
        cout << left << setw(35) << product.name << right << setw(30) << "Php " << product.price << setw(30) << product.quantity << " Piece/s\n";
    }
}

// Function to display a summary of the items in the shopping cart
void cartSummary(const vector<Product>& cart) {
    cout << left << setw(35) << "PRODUCT NAME" << right << setw(32) <<"PRICE" << setw(35) << "QTY\n";
    for (const Product& product : cart) {
        cout << left << setw(35) << product.name << right << setw(30) << "Php " << product.price << setw(30) << product.quantity << " Piece/s\n";
    }
}

// Function to calculate the total cost of items in the shopping cart
double calculateTotal(const vector<Product>& cart) {
    return accumulate(cart.begin(), cart.end(), 0.0,
                      [](double sum, const Product& product) { return sum + product.price * product.quantity; });
}

// Function to process the payment, calculate change, and return the payment amount
double processPayment(double totalCost) {
    double payment;
    cout << "Enter payment amount: Php ";
    cin >> payment;

    // Ensure that the payment is sufficient
    while (payment < totalCost) {
        cout << "Insufficient payment. Please enter a valid amount: Php ";
        cin >> payment;
    }

    // Calculate and display change if there is any
    double change = payment - totalCost;
    if (change > 0) {
        cout << "Change: Php " << fixed << setprecision(2) << change << endl;
    }

    return payment;
}

// Function to generate a receipt based on the items in the shopping cart and the total cost
void generateReceipt(const vector<Product>& cart, double totalCost) {
    horizontalLine(120, '*', "R E C E I P T");  // Display receipt header
    horizontalLine(120, '*');
    cartSummary(cart);  // Display cart summary
    cout << "\nTotal: Php " << fixed << setprecision(2) << totalCost << endl;

    double payment = processPayment(totalCost);  // Process payment

    cout << "\nThank you for shopping with us!\n";
}

// Function to print a horizontal line of a specified length with default character '='
void horizontalLine(int length) {
    for(int i = 1; i <=length; i++) {
        cout << "=";
    }
    cout << "\n";
}

// Overloaded function to print a horizontal line with a specified character
void horizontalLine(int length, char character) {
    for(int i = 1; i <=length; i++) {
        cout << character;
    }
    cout << "\n";
}

// Overloaded function to print a horizontal line with a centered string prompt
void horizontalLine(int length, char character, string prompt) {
    int sideLength = (length - int(prompt.length()) - 2) / 2;
    for (int i = 0; i < sideLength; ++i) {
        cout << character;
    }
    cout << " " << prompt << " ";
    for (int i = 0; i < sideLength + (length - int(prompt.length()) - 2) % 2; ++i) {
        cout << character;
    }
    cout << endl;
}

