import java.util.ArrayList;
class Student{
  int studentID;
  String studentName;
  ArrayList<Course> enrolledCourses;
  int currentCredits;
  int maxCredits;
  public Student(int studentID,String name){
    this.studentID=studentID;
    this.studentName=name;
    this.enrolledCourses=new ArrayList<Course>();
    this.currentCredits=0;
    this.maxCredits=25;
  }
  public Student(int studentID,String name,int maxCredits){
    this.studentID=studentID;
    this.studentName=name;
    this.enrolledCourses=new ArrayList<Course>();
    this.currentCredits=0;
    this.maxCredits=maxCredits;
  }
  Course getCourse(int id){
    return enrolledCourses.get(id);
  }
  void enroll(Course course){
    if(course.isFull()){
      System.out.printf("Course %d is full\n",course.getCourseID());
    }else{
      if(currentCredits+course.getCredits()>maxCredits){
        System.out.printf("Student %d cannot enroll this course\n",studentID);
      }
      else{
        enrolledCourses.add(course);
        currentCredits+=course.getCredits();
        course.enroll();
      }
    }
  }
  void drop(Course course){
    int id=course.getCourseID(),flag=1;
    for(int i=0;i<enrolledCourses.size();i++){
      if(enrolledCourses.get(i).getCourseID()==id){
        enrolledCourses.remove(i);
        currentCredits-=course.getCredits();
        course.drop();
        flag=0;
        break;
      }
    }
    if(flag==1)System.out.printf("Course %d not found in student %d\n",id,studentID);
  }
  void drop(int courseID){
    int id=courseID,flag=1;
    for(int i=0;i<enrolledCourses.size();i++){
      if(enrolledCourses.get(i).getCourseID()==id){
        currentCredits-=enrolledCourses.get(i).getCredits();
        enrolledCourses.get(i).drop();
        enrolledCourses.remove(i);
        flag=0;
        break;
      }
    }
    if(flag==1)System.out.printf("Course %d not found in student %d\n",id,studentID);
  }
  String getInfo(){
    String info=String.format("Student ID: %d\nName: %s\nCredits: %d/%d\nCourse list:\n",studentID,studentName,currentCredits,maxCredits);
    for(int i=0;i<enrolledCourses.size();i++){
      info+=(enrolledCourses.get(i).getCourseID()+" "+enrolledCourses.get(i).getCourseName()+" "+enrolledCourses.get(i).getCredits())+"\n";
    }
    return info;
  }
}
//Course
class Course{
  int courseID;
  String courseName;
  int credits;
  int capacity;
  int enrolled;
  public Course(int id,String name,int credits,int capacity){
    this.courseID=id;
    this.courseName=name;
    this.credits=credits;
    this.capacity=capacity;
  }
  public int getCourseID(){
    return courseID;
  }
  public String getCourseName(){
    return courseName;
  }
  public int getCredits(){
    return credits;
  }
  public int getCapacity(){
    return capacity;
  }
  public boolean isFull(){
    return enrolled==capacity;
  }
  public void enroll(){
    enrolled++;
  }
  public void drop(){
    enrolled--;
  }
  public String getInfo(){
    return courseID+" "+courseName+" "+credits+" "+enrolled+"/"+capacity;
  } 
}

