class Tile(pg.sprite.Sprite):
    images: List[pg.Surface] = []

    sounds = {
        "knock": []
    }

    def __init__(self, _id, *groups):
        pg.sprite.Sprite.__init__(self, *groups)
        self.__id = _id
        self.__tile_type = 0  # index image dibagi 4
        self.__tile_alignment = 0
        self.__inclusion = False

        self.image = self.images[self.__tile_type]
        self.rect = self.image.get_rect(topleft=(333 + (self.__id % 7) * 60, 105 + (self.__id // 7) * 60))

        self.__roads = [None, None, None, None]  # [East, South, West, North]
        self.__previous = None
        self.__neighbors = []
        self.__visited = False

    def __str__(self):
        string_roads = ""
        for i in range(4):
            string_roads += f"{self.__roads[i]}{'' if i == 3 else ' - '}"
        return f"{string_roads}"

    def __repr__(self):
        return f"<TileID {repr(self.__id)}>"

    def get_id(self):
        return self.__id

    def set_id(self, _id):
        self.__id = _id

    def get_type(self):
        return self.__tile_type

    def get_alignment(self):
        return self.__tile_alignment

    def get_inclusion(self):
        return self.__inclusion

    def set_inclusion(self, _value: bool):
        self.__inclusion = _value

    def get_roads(self, _num: int):
        return self.__roads[_num]

    def get_roads_list(self):
        return self.__roads

    def set_roads(self, _txt_repr: str, _list_buildings: List):
        if _txt_repr == "1":  # bangunan
            self.__roads = [0, 1, 0, 0]
            self.__tile_type = 4
            _list_buildings.append(self)
        elif _txt_repr == "2":  # jalan 2-arah (lurus)
            self.__roads = [1, 0, 1, 0]
            self.__tile_type = 0
        elif _txt_repr == "@":  # jalan 2-arah (berbelok)
            self.__roads = [1, 1, 0, 0]
            self.__tile_type = 1
        elif _txt_repr == "3":  # jalan 3-arah
            self.__roads = [1, 1, 1, 0]
            self.__tile_type = 2
        elif _txt_repr == "4":  # jalan 4-arah
            self.__roads = [1, 1, 1, 1]
            self.__tile_type = 3
        elif _txt_repr == "0":  # tanah kosong
            self.__roads = [0, 0, 0, 0]
            self.__tile_type = 5
        elif _txt_repr == "#":  # jalan 2-arah (berbelok; ERT)
            self.__roads = [1, 1, 0, 0]
            self.__tile_type = 19
        elif _txt_repr == "P":  # jalan 3-arah (pasar)
            self.__roads = [1, 1, 1, 0]
            self.__tile_type = 18
        else:
            raise Exception(f"Check the text file, which perhaps contains the illegal value {_txt_repr}.")
        self.image = self.images[self.__tile_type * 4].copy()
        # self.image.set_alpha(120)
        self.__tile_alignment = 0

        # Randomly rotate the tile 0, 1, 2, or 3 times upon generation
        for i in range(randint(0, 3)):
            self.rotate_roads()

    def rotate_roads(self, _button=None):
        print(f"[DEBUG] Rotating tile of ID #{self.__id}; BEFORE: {self.__roads}", end="")

        if _button in (None, 1, 3):
            if _button is None or _button == 3:  # None -> by the program when setting up board; 3 -> right click
                self.__roads = self.__roads[-1:] + self.__roads[:-1]
                self.__tile_alignment = (self.__tile_alignment - 1) % 4
            elif _button == 1:  # 1 -> left click
                self.__roads = self.__roads[1:] + self.__roads[:1]
                self.__tile_alignment = (self.__tile_alignment + 1) % 4

            if _button in (1, 3) and pg.mixer and VOLUME is True:
                Tile.sounds["knock"][randint(0, len(Tile.sounds["knock"]) - 1)].play()

        print(f"; AFTER: {self.__roads}")

    def get_building_type(self):
        return self.__building_type

    def set_building_type(self, _i: int):
        self.__building_type = _i

    def erase_previous(self):
        self.__previous = None

    def get_previous(self):
        return self.__previous

    def set_previous(self, _node):
        self.__previous = _node

    def add_neighbor(self, _node):
        self.__neighbors.append(_node)

    def erase_neighbors(self):
        self.__neighbors = []

    def get_neighbors(self):
        return self.__neighbors

    def get_visited(self):
        return self.__visited

    def set_visited(self, _value: bool):
        self.__visited = _value


class LayoutGenerator:
