    def __init__(self, _all):
        self.__size = 7
        self.__size_pow = self.create_size_pow()
        self.rect = pg.Rect(333, 105, self.__size * 60, self.__size * 60)
        self.__list_tiles = self.create_list_tiles(_all)
        self.__shortest_paths = []
        self.__list_buildings = []
        self.__variasi = 0

    def __str__(self):
        string_tiles = ""
        for i in range(self.__size_pow):
            string_tiles += f"[{i}] {self.__list_tiles[i]}\n"
        return f"{string_tiles}"

    def __repr__(self):
        str_output = ""
        i = 0
        for each_tile in self.__list_tiles:
            str_output += f"[i: {i}; ID: {each_tile.get_id()}]"
            i += 1
        return str_output

    def create_size_pow(self):
        return self.__size ** 2

    def create_list_tiles(self, _all):
        temp_list = []
        for i in range(self.__size_pow):
            temp_list.append(Tile(i, _all))
