    def generate_tiles(self, _filename: str, _babak: int, _level: int):
        self.__list_buildings.clear()
        input_file = open(os.path.join(MAIN_DIR, "level_design", _filename), "r")

        index_row = 0
        while index_row < self.__size:
            list_row: List = input_file.readline().split(",")
            list_row[-1] = list(list_row[-1])
            list_row[-1] = list_row[-1][0]
            assert len(list_row) == self.__size
            for index_column in range(self.__size):
                self.__list_tiles[index_row * 7 + index_column].set_roads(list_row[index_column], self.__list_buildings)
            index_row += 1

        input_file.close()

        # Variation for
        if len(self.__list_buildings) == 2:
            self.__variasi = sample((0, 1, 3), 1)[0]
        elif len(self.__list_buildings) == 3:
            self.__variasi = sample((2, 4), 1)[0]

        self.modify_building_appearance(_level, _babak)
        self.update_neighbors_of_each_tile()
        self.update_shortest_paths()
        self.update_appearance_of_each_tile(_level, _babak)

    def generate_shortest_paths(self):
        self.__shortest_paths.clear()
        for i in range(len(self.__list_buildings)):
            for j in range(i + 1, len(self.__list_buildings)):
                self.__shortest_paths.append(ShortestPath(self.__list_buildings[i], self.__list_buildings[j]))

    def modify_building_appearance(self, _level: int, _babak: int):
        if _level == 3:  # time trial level
            if len(self.__list_buildings) == 2:
                for i, e in enumerate(self.__list_buildings):
                    print(f"[CLING] {i} {CityBlock.building_types[_level][self.__variasi] = }")
                    e.image = Tile.images[CityBlock.building_types[_level][self.__variasi][i] + e.get_alignment()].copy()
            elif len(self.__list_buildings) == 3:
                for i, e in enumerate(self.__list_buildings):
                    print(f"[CLANG] {i} {CityBlock.building_types[_level][self.__variasi] = }")
                    e.image = Tile.images[CityBlock.building_types[_level][self.__variasi][i] + e.get_alignment()].copy()
            else:
                raise ValueError(self.__list_buildings)

        else:  # story level
            i_building = 0
            for i, e in enumerate(self.__list_tiles):
                if e in self.__list_buildings:
                    if i_building == len(self.__list_buildings):  # No building left to modify the appearance of
                        break
                    else:
                        e.image = Tile.images[CityBlock.building_types[_level][_babak][i_building] + e.get_alignment()].copy()
                        i_building += 1

    def update_neighbors_of_each_tile(self):
        print(f"[DEBUG] [ANT BEGIN]")

        for i, e in enumerate(self.__list_tiles):
            e.erase_neighbors()

            # East and west connects
            if i % 7 != 6 and self.__list_tiles[i].get_roads(0) and self.__list_tiles[i + 1].get_roads(2):
                self.__list_tiles[i].add_neighbor(self.__list_tiles[i + 1])

            # South and north connects
            if i < 42 and self.__list_tiles[i].get_roads(1) and self.__list_tiles[i + 7].get_roads(3):
                self.__list_tiles[i].add_neighbor(self.__list_tiles[i + 7])

            # West and east connects
            if i % 7 != 0 and self.__list_tiles[i].get_roads(2) and self.__list_tiles[i - 1].get_roads(0):
                self.__list_tiles[i].add_neighbor(self.__list_tiles[i - 1])

            # North and south connects
            if i > 6 and self.__list_tiles[i].get_roads(3) and self.__list_tiles[i - 7].get_roads(1):
                self.__list_tiles[i].add_neighbor(self.__list_tiles[i - 7])

            print(f"[DEBUG] {i = }; {self.__list_tiles[i].get_roads_list()}; {self.__list_tiles[i].get_neighbors()}")

        print(f"[DEBUG] [ANT END]")

    def update_shortest_paths(self):
        print("[DEBUG] [WATER] updateshortestpaths")
        self.generate_shortest_paths()  # Regenerate ShortestPath objects

        for i, e in enumerate(self.__list_tiles):
            e.set_inclusion(False)

        print(f"[DEBUG] [THIS] [self.__shortest_paths] -> {repr(self.__shortest_paths)} ({len(self.__shortest_paths)})")
        dont_bother = False

        for i, each_path in enumerate(self.__shortest_paths):
            for j, e in enumerate(self.__list_tiles):
                e.set_visited(False)
                e.erase_previous()
            each_path.bfs()
            route = each_path.get_route()
            print(f"[DEBUG] [MACH] {repr(each_path)}")
            if len(route) < 2:  # if a building doesn't connect to every other one, don't bother
                dont_bother = True
                print("Failed to bother.")
                break

        if not dont_bother:
            for i, each_path in enumerate(self.__shortest_paths):
                route = each_path.get_route()
                for each_tile in route:
                    each_tile.set_inclusion(True)

            count_ert = 0
            for e in self.__list_tiles:
                if e.get_type() == 19 and e.get_inclusion() is True:
                    count_ert += 1
            print(f"{count_ert = }")
            if count_ert > 0 and pg.mixer and VOLUME is True:
                CityBlock.sounds["bonus"][randint(0, len(CityBlock.sounds["bonus"]) - 1)].play()

            return True, count_ert

    def fill(self, surface, color):
        """
        https://stackoverflow.com/questions/42821442/how-do-i-change-the-colour-of-an-image-in-pygame-without-changing-its-transparen
        Fill all pixels of the surface with color, preserve transparency.
        """
        w, h = surface.get_size()
        r, g, b, _ = color
        for x in range(w):
            for y in range(h):
                a = surface.get_at((x, y))[3]
                surface.set_at((x, y), pg.Color(r, g, b, a))

    def update_appearance_of_each_tile(self, _level: int, _babak: int):
        variasi = self.__variasi if _level == 3 else _babak
        print(f"{variasi = }")
        i_building = 0
        for i, e in enumerate(self.__list_tiles):
            if e in self.__list_buildings:
                print(f"[BELL] {i_building = } {CityBlock.building_types[_level][variasi] = }")
                e.image = Tile.images[CityBlock.building_types[_level][variasi][i_building] + e.get_alignment()].copy()
                i_building += 1
            else:
                e.image = e.images[e.get_type() * 4 + e.get_alignment()].copy()

            if e.get_inclusion() is True:
                print(f"[DEBUG] Setting color of {repr(e)} to opaque.")
                self.fill(e.image, WHITE_RGBA)

    def rotate_tile(self, _coords, _button):
        if self.rect.collidepoint(_coords):  # If clicking inside city block area
            print(f"[DEBUG] Clicking inside city block!")
            for each_tile in self.__list_tiles:  #
                if each_tile.rect.collidepoint(_coords):
                    each_tile.rotate_roads(_button)
                    break
            return True

        else:  # If clicking outside city block area
            return False


class ShortestPath:
    def __init__(self, _start, _end):
        self.__start = _start
        self.__end = _end
        self.__route = []

    def __repr__(self):
        return f"<ShortestPath | self.__start: {repr(self.__start)} | self.__end: {repr(self.__end)} | self.__route: {repr(self.__route)}>"

    def get_route(self):
        return self.__route

    def bfs(self):
        # Create a queue
        queue = []
        # Visit and add the start node to the queue
        self.__start.visited = True
        queue.append(self.__start)

        success = False
        # BFS until queue is empty
        while queue:
            # Pop a node from queue for search operation
            current_node = queue.pop(0)
            print(f"[DEBUG] [BFS] current_node: {repr(current_node)}")
            # Loop through neighboring nodes to find the 'end' node
            for neighbor in current_node.get_neighbors():
                print(f"[DEBUG] [BFS] get_neighbors: {repr(current_node.get_neighbors())}")
                if not neighbor.get_visited():
                    print(f"[DEBUG] [BFS] neighbor: {repr(neighbor)}; get_visited: False")
                    # Visit and add neighboring nodes to the queue
                    neighbor.set_visited(True)
                    queue.append(neighbor)
                    # Update its preceding node
                    neighbor.set_previous(current_node)
                    # Stop BFS if the visited node is the end node
                    if neighbor == self.__end:
                        print(f"[DEBUG] [BFS] A way from __start to __end has been found!")
                        success = True
                        queue.clear()
                        # BFS completed, now trace the route
                        # self.trace_route()  # Kupindahkan dari bawah
                        break
                pass
            pass
        pass

        # BFS completed, now trace the route
        self.trace_route() if success is True else None

    # Function to trace the route using preceding nodes
    def trace_route(self):
        node = self.__end
        print(f"[DEBUG] [TRACEROUTE] node: {repr(node)}")
        self.__route.clear()
        # Since start node has no preceding node, loop until node->prev is null
        while node != self.__start:
            self.__route.append(node)
            if node != self.__start:
                print(f"[DEBUG] [TRACEROUTE] node: {repr(node)} | prev: {repr(node.get_previous())}")
            node = node.get_previous()
        self.__route.append(self.__start)
        # Reverse the route, bringing start to the front
        self.__route.reverse()
        print(f"[DEBUG] [TRACEROUTE] route: {repr(self.__route)})")


class Scene(ABC):
    @abstractmethod
    def do_once(self):
