class RecordData:
    def __init__(self):
        """
        Expectation:
        self.__list_record_data = [ 240, 300, 360, 14
                                    60, 120, "X", "X"
                                    "X", "X", "X", "X" ]
        """
        self.__list_record_data = [["X" for j in range(4)] for i in range(3)]

    def __repr__(self):
        return "list_record_data = " + ", ".join([str(_) for _ in self.__list_record_data])

    def sec_to_minsec(self, sec: int):
        val_mins = sec // 60
        val_secs = sec % 60
        if val_mins < 10:
            val_mins = f"0{val_mins}"
        if val_secs < 10:
            val_secs = f"0{val_secs}"
        return f"{val_mins}:{val_secs}"

    def get_record(self, _row_index: int, _col_index: int):
        ori_output: str = self.__list_record_data[_row_index][_col_index]
        print(f"[DEBUG] [ARVIN] {ori_output}")
        if ori_output is None:  # Reading record from level yet to be unlocked
            return None
        else:
            if _col_index == 3:
                return ori_output  # ori_output is a numstring -> rounds completed
            else:
                print(f"[DEBUG] [GRACIA] {int(ori_output)}")
                return self.sec_to_minsec(int(ori_output))  # ori_output is a numstring -> seconds spent

    def set_record(self, _row_index: int, _col_index: int, _new_val: str or int):
        self.__list_record_data[_row_index][_col_index] = _new_val


