        print(f"[DEBUG] SaveDataModifier: rewrite_saved_data")

        input_file = open(os.path.join(MAIN_DIR, "user_data", "save_data.txt"), "r")
        output_list = []
        index_row = 0
        while index_row < 3:
            read_line = input_file.readline()
            if index_row == _index:
                output_list.append(_spanish_lingo + ("\n" if index_row < 2 else ""))
                print(f"[DEBUG] [FRA] {_spanish_lingo} {index_row}")
            else:
                print(f"[DEBUG] [FRE] {[read_line]}")
                output_list.append(read_line)
            index_row += 1
        input_file.close()

        print(output_list)

        output_file = open(os.path.join(MAIN_DIR, "user_data", "save_data.txt"), "w")
        for i, e in enumerate(output_list):
            output_file.write(str(e))
        output_file.close()

    def reprocess_saved_data(self):
        print(f"[DEBUG] SaveDataModifier: reprocess_saved_data")
        input_file = open(os.path.join(MAIN_DIR, "user_data", "save_data.txt"), "r")

        index_row = 0
        while index_row < 3:
            read_line = input_file.readline()
            if "Cero" in read_line:
                print("ZEROOO", self._save_data)
                self._save_data.set_save(index_row, 0)
            elif "Uno" in read_line:
                self._save_data.set_save(index_row, 30)
            elif "Dos" in read_line:
                self._save_data.set_save(index_row, 60)
            elif "Tres" in read_line:
                self._save_data.set_save(index_row, 100)
            else:
                print(f"[DEBUG] Corrupt save data file! Found `{read_line}` instead.")
                pass
            index_row += 1

        input_file.close()

    def erase_record_data(self, _index_record: int):
        print(f"[DEBUG] RecordDataModifier: erase_record_data")

        input_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "r")
        output_list = []
        index_row = 0
        while index_row < 3:
            read_line = input_file.readline()
            if index_row == _index_record:
                read_line = "X,X,X,X"
            output_list.append(read_line)
            index_row += 1
        input_file.close()

        print(output_list)

        output_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "w")
        for i, e in enumerate(output_list):
            output_file.write(str(e))
        output_file.close()

    def rewrite_record_data(self, _index_record: int, _index_level: int, _new_val: str):
        print(f"[DEBUG] RecordDataModifier: rewrite_record_data")

        input_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "r")
        output_list = []
        index_row = 0
        while index_row < 3:
            read_line = input_file.readline()
            if index_row == _index_record:
                list_read_line = read_line.split(",")
                if _index_level == 3:
                    list_read_line[3] = f"{_new_val}\n"
                else:
                    list_read_line[_index_level] = _new_val
                read_line = ",".join(list_read_line)
            output_list.append(read_line)
            index_row += 1
        input_file.close()

        print(f"[DEBUG] [HAM] {output_list}")

        output_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "w")
        for i, e in enumerate(output_list):
            output_file.write(str(e))
        output_file.close()

    def reprocess_record_data(self):
        print(f"[DEBUG] RecordDataModifier: reprocess_record_data")

        input_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "r")

        index_row = 0
        while index_row < 3:
            list_read_line = input_file.readline().split(",")
            for index_col, e in enumerate(list_read_line):
                try:
                    value_for_record_data = int(e)
                except:
                    value_for_record_data = None
                self._record_data.set_record(index_row, index_col, value_for_record_data)
            index_row += 1

        input_file.close()

    def update_appearance(self):
        print("[DEBUG] [BEGIN] [update_appearance()]")
        progress_percentage = self._save_data.get_save(self.accessed_save)  # outputs 30 if haven't beaten level two (index 1)
        progress_on_this_save = SaveDataModifier.convert_percentage_to_int[progress_percentage]  # outputs 1 if haven't beaten level two (index 1)
        record_for_this_level = self._record_data.get_record(self.accessed_save, self.__selected)

        # Update pin images
        for i, e in enumerate(self.list_ui_pins):
            if i <= progress_on_this_save:
                if i == self.__selected:
                    e.image = SceneMap.images[i][1]  # give pin a blue highlight
                else:
                    e.image = SceneMap.images[i][0]  # make sure pin doesn't have a blue highlight
            else:
                e.image = SceneMap.images["1x1"]

        # Update text
        self.ui_level_desc.update_appearance(self.__selected, progress_on_this_save, record_for_this_level)
        print("[DEBUG] [END] [update_appearance()]")

    def do_once(self):
        print("[DEBUG] [BEGIN] [do_once()]")
        if pg.mixer:
            self.ui_sound.reprocess()
            global MUSIC, VOLUME
            if MUSIC != 2:
                pg.mixer.music.fadeout(2000)
                music = os.path.join(MAIN_DIR, "assets", "Remnants of Effervescence.wav")
                pg.mixer.music.load(music)
                if VOLUME is False:
                    pg.mixer.music.set_volume(0)
                pg.mixer.music.play(-1)
                MUSIC = 2

        self.reprocess_saved_data()
        self.reprocess_record_data()
        progress_percentage = self._save_data.get_save(self.accessed_save)
        self.__selected = SaveDataModifier.convert_percentage_to_int[progress_percentage]
        self.update_appearance()
        print("[DEBUG] [END] [do_once()]")

    def update(self, _dt: float):
        pass

    def play_mouse_click(self, _coords, _button):
        print("[DEBUG] [SceneMap] [play_mouse_click()]")
        progress_percentage = self._save_data.get_save(self.accessed_save)  # outputs 30 if haven't beaten level two (index 1)
        progress_on_this_save = SaveDataModifier.convert_percentage_to_int[progress_percentage]  # outputs 1 if haven't beaten level two (index 1)

        if _button == 1:  # If left mouse button
            if self.ui_back.rect.collidepoint(_coords):
                return "save", None, None
            elif self.list_ui_pins[0].rect.collidepoint(_coords):  # If clicking Level 1 button
                if self.__selected != 0:
                    self.__selected = 0
                else:
                    return "gameplay", self.accessed_save, 0
            elif self.list_ui_pins[1].rect.collidepoint(_coords) and progress_on_this_save > 0:  # If clicking Level 2 button
                if self.__selected != 1:
                    self.__selected = 1
                else:
                    return "gameplay", self.accessed_save, 1
            elif self.list_ui_pins[2].rect.collidepoint(_coords) and progress_on_this_save > 1:  # If clicking Level 3 button
                if self.__selected != 2:
                    self.__selected = 2
                else:
                    return "gameplay", self.accessed_save, 2
            elif self.list_ui_pins[3].rect.collidepoint(_coords) and progress_on_this_save > 2:  # If clicking Time Trial button
                if self.__selected != 3:
                    self.__selected = 3
                else:
                    return "gameplay", self.accessed_save, 3
            elif self.ui_sound.rect.collidepoint(_coords):
                self.ui_sound.mute()

            self.update_appearance()


