class UILevelDesc(pg.sprite.Sprite):
    img = None
    level_names = {
        0: "Rappocini",
        1: "Biringkanaya",
        2: "Bandara Sultan Hasanuddin",
        3: "Pantai Losari"
    }

    def __init__(self, _img, *groups):
        pg.sprite.Sprite.__init__(self, *groups)
        self.textA = self.create_text("Level X - XXXXX", 214, 450, *groups)
        self.textB = self.create_text("(Rekor: XX:XX)", 214, 490, *groups)
        self.textC = self.create_text("- Tekan lagi untuk melanjutkan! -", 214, 530, *groups)
        self.image = _img
        self.rect = pg.Rect(0, 0, 1, 1)

    def create_text(self, _msg: str, _x: int, _y: int, *groups):
        return Text(_msg, "big", _x, _y, WHITE, True, *groups)

    def update_appearance(self, _i: int, _progress: int, _record: None or str):
        print(f"[FLOUR] {_i = } {_progress = }")
        if _i > _progress:  # level locked
            self.textA.set_msg("")
            self.textB.set_msg("")
            self.textC.set_msg("")

        elif _i < 3:  # story level unlocked
            self.textA.set_msg(f"Level {_i + 1} - {UILevelDesc.level_names[_i]}")
            if _record is None:
                self.textB.set_msg("(Rekor: XX:XX)")
            else:
                self.textB.set_msg(f"(Rekor: {_record})")

        else:  # time trial level unlocked
            self.textA.set_msg(f"Time Trial - {UILevelDesc.level_names[_i]}")
            if _record is None:
                self.textB.set_msg("(Rekor: X babak)")
            else:
                self.textB.set_msg(f"(Rekor: {_record} babak)")

        self.textA.rerender()
        self.textB.rerender()
        self.textC.rerender()

        self.textA.align("center")
        self.textB.align("center")
        self.textC.align("center")


