    def rewrite_record_data(self, _index_record: int, _index_level: int, _new_val: str):
        print(f"[DEBUG] [HARMEW] RecordDataModifier: rewrite_record_data")

        input_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "r")
        output_list = []
        index_row = 0
        while index_row < 3:
            read_line = input_file.readline()
            if index_row == _index_record:
                list_read_line = read_line.split(",")
                if _index_level == 3:
                    list_read_line[3] = f"{_new_val}\n"
                else:
                    list_read_line[_index_level] = _new_val
                read_line = ",".join(list_read_line)
            output_list.append(read_line)
            index_row += 1
        input_file.close()

        print(f"[DEBUG] [HAM] {output_list}")

        output_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "w")
        for i, e in enumerate(output_list):
            output_file.write(str(e))
        output_file.close()

    def reprocess_record_data(self):
        print(f"[DEBUG] RecordDataModifier: reprocess_record_data")

        input_file = open(os.path.join(MAIN_DIR, "user_data", "record_data.txt"), "r")

        index_row = 0
        while index_row < 3:
            list_read_line = input_file.readline().split(",")
            for index_col, e in enumerate(list_read_line):
                try:
                    value_for_record_data = int(e)
                except:
                    value_for_record_data = None
                self._record_data.set_record(index_row, index_col, value_for_record_data)
            index_row += 1

        input_file.close()

    def do_once(self):
        # Mulai dari babak ke-0
        self.__babak = 0
        self.__game_over = False
        self.__max_babak = SceneGameplay.max_babak[self.accessed_level]
        self.__picked_layouts.clear()
        self.__time_for_a_new_round = 0

        # Putar musik sesuai level
        if pg.mixer:
            self.ui_sound.reprocess()
            global MUSIC, VOLUME
            pg.mixer.music.fadeout(2000)

            if self.accessed_level not in range(4):
                raise ValueError(self.accessed_level)
            elif self.accessed_level == 0:
                music = os.path.join(MAIN_DIR, "assets", "Daylight Rising.wav")
                MUSIC = 0
            elif self.accessed_level == 1:
                music = os.path.join(MAIN_DIR, "assets", "Aitienpaiva 22.wav")
                MUSIC = 1
            elif self.accessed_level == 2:
                music = os.path.join(MAIN_DIR, "assets", "Remnants of Effervescence.wav")
                MUSIC = 2
            else:
                music = os.path.join(MAIN_DIR, "assets", "Springtime Morning Birdsong.wav")
                MUSIC = 3

            pg.mixer.music.load(music)
            if VOLUME is False:
                pg.mixer.music.set_volume(0)
            pg.mixer.music.play(-1)

        # Pilih warna Square dan Blank yang sesuai
        for blank in self.blanks:
            blank.image = SceneGameplay.images["blank"][self.accessed_level]
        self.ui_square.image = SceneGameplay.images["square"][self.accessed_level]

        # Ambil sampel N layout acak
        count_buildings = None
        berapa_babak = None

        if self.accessed_level == 0:
            if self.__babak in (0, 1, 3, 4):
                count_buildings = 0  # actually 2
            elif self.__babak in (2, 5):
                count_buildings = 1  # actually 3
            else:
                raise ValueError(self.__babak)
            berapa_babak = 6

        elif self.accessed_level == 1:
            if self.__babak in (0, 1, 2, 4, 6, 7):
                count_buildings = 0  # actually 2
            elif self.__babak in (3, 5):
                count_buildings = 1  # actually 3
            else:
                raise ValueError(self.__babak)
            berapa_babak = 8

        elif self.accessed_level == 2:
            if self.__babak in (0, 1, 3, 4, 5, 8):
                count_buildings = 0  # actually 2
            elif self.__babak in (2, 6, 7):
                count_buildings = 1  # actually 3
            elif self.__babak == 9:
                count_buildings = 2  # actually 3
            else:
                raise ValueError(self.__babak)
            berapa_babak = 10

        elif self.accessed_level == 3:
            pass

        else:
            raise ValueError(self.accessed_level)

        if self.accessed_level == 3:
            temp = SceneGameplay.level_layouts[3][0] + SceneGameplay.level_layouts[3][1]
            print(f"[GAR] {len(temp) = } {temp}")
            self.__picked_layouts = sample(temp, 20)
            self.city_block.generate_tiles(self.__picked_layouts[self.__babak], self.__babak, self.accessed_level)
        else:
            if self.accessed_level == 0:
                samp2 = sample(SceneGameplay.level_layouts[0][0], 4)
                samp3 = sample(SceneGameplay.level_layouts[0][1], 2)
                self.__picked_layouts = [samp2[0], samp2[1], samp3[0], samp2[2], samp2[3], samp2[1]]
            elif self.accessed_level == 1:
                samp2 = sample(SceneGameplay.level_layouts[1][0], 5)
                samp3 = sample(SceneGameplay.level_layouts[1][1], 3)
                self.__picked_layouts = [samp2[0], samp2[1], samp2[2], samp3[0], samp2[3], samp3[1], samp2[4], samp3[2]]
            elif self.accessed_level == 2:
                samp2 = sample(SceneGameplay.level_layouts[2][0], 6)
                samp3 = sample(SceneGameplay.level_layouts[2][1], 3)
                samp4 = sample(SceneGameplay.level_layouts[2][2], 1)
                self.__picked_layouts = [samp2[0], samp2[1], samp3[0], samp2[2], samp2[3], samp2[4], samp3[1], samp3[2], samp2[5], samp4[0]]
            # Reset the board
            self.city_block.generate_tiles(self.__picked_layouts[self.__babak], self.__babak, self.accessed_level)

        # Set clock mulai dari detik ke-180 bila TTM atau ke-0 bila SM
        if self.accessed_level == 3:  # time trial
            self.__timer = 180
        else:
            self.__timer = 0
        self.__real_timer = 0

        # Fill in the dialogue queue
        self.ui_bubble.reset()
        self.ui_bubble.set_queue(SceneGameplay.dialogue[self.accessed_level])
        self.ui_bubble.set_queue1(SceneGameplay.dialogue1[self.accessed_level])
        self.ui_bubble.set_queue2(SceneGameplay.dialogue2[self.accessed_level])
        self.ui_bubble.set_queue3(SceneGameplay.dialogue3[self.accessed_level])

        # Make sure the victory screen is invisible
        self.ui_victory_screen.generate_text()

        # 'Initialize' saved_data and record_data
        self.reprocess_saved_data()
        self.reprocess_record_data()

    def update(self, _dt: float):
        if self.__game_over:
            return

        # Increment or decrement the timer
        if self.accessed_level == 3:  # Time trial level; decrement timer
            self.__timer -=  _dt
            self.__real_timer += _dt
            if self.__timer <= 0:  # Time trial level ends
                self.__timer = 0
                self.__game_over = True

                # If user has created a new record
                is_new_record = False
                print(f"[GURA] {self._record_data.get_record(self.accessed_save, self.accessed_level)}")
                print(f"[GARU] {self._record_data}")

                old_record_str = self._record_data.get_record(self.accessed_save, self.accessed_level)
                if old_record_str is not None:
                    old_record_int = int(old_record_str)

                if old_record_str is None or old_record_int < self.__babak:
                    new_record_str = str(self.__babak)
                    self.rewrite_record_data(self.accessed_save, self.accessed_level, new_record_str)
                    is_new_record = True

                self.ui_victory_screen.update_appearance(self.accessed_level, self.__babak, is_new_record)
                self.ui_victory_screen.set_visibility()

        else:  # Story mode level; increment timer
            self.__timer += _dt
            self.__real_timer += _dt

        # After highlighting the tiles involved, wait for a bit, then reset the board
        if self.__time_for_a_new_round == 1:
            self.__time_for_a_new_round = 2

        elif self.__time_for_a_new_round == 2:
            self.__time_for_a_new_round = 0

            # Reset the board
            pg.time.wait(750)
            if self.accessed_level == 3:  # Time trial level
                self.city_block.generate_tiles(self.__picked_layouts[self.__babak % 20], self.__babak, self.accessed_level)
            else:  # Story level
                self.city_block.generate_tiles(self.__picked_layouts[self.__babak], self.__babak, self.accessed_level)

        # Backend stuffs necessary to update appearance
        self.update_appearance()

    def play_mouse_click(self, _coords, _button):
        # If the game is over, return to the map
        if self.__game_over:
            return "map", self.accessed_save, None

        if self.city_block.rotate_tile(_coords, _button) is True:  # Rotate the tile clicked, if any
            self.city_block.update_neighbors_of_each_tile()
            output = self.city_block.update_shortest_paths()
            print(f"GLOOM {output}")
            if output is None:
                round_completed = False
            else:
                round_completed = output[0]
                if self.accessed_level == 3:  # for time trial, count the ERTs used
                    count_ert = output[1]
                if pg.mixer and VOLUME is True:
                    SceneGameplay.sounds["tune"][randint(0, len(SceneGameplay.sounds["tune"]) - 1)].play()
            self.city_block.update_appearance_of_each_tile(self.accessed_level, self.__babak)

            if round_completed:
                self.__babak += 1
                self.__time_for_a_new_round = 1
                if self.accessed_level < 3 and self.__babak == self.__max_babak:  # Story mode level ends
                    self.__game_over = True

                    # If user hasn't completed this level before
                    if self._save_data.get_save(self.accessed_save) < 30 and self.accessed_level == 0:
                        self.rewrite_saved_data(self.accessed_save, 'Uno')
                    elif self._save_data.get_save(self.accessed_save) < 60 and self.accessed_level == 1:
                        self.rewrite_saved_data(self.accessed_save, 'Dos')
                    elif self._save_data.get_save(self.accessed_save) < 100 and self.accessed_level == 2:
                        self.rewrite_saved_data(self.accessed_save, 'Tres')
                    else:
                        pass
                    self.reprocess_saved_data()

                    # If user has created a new record
                    end_time: int = floor(self.__timer)

                    is_new_record = False

                    old_record_str = self._record_data.get_record(self.accessed_save, self.accessed_level)
                    if old_record_str is not None:
                        old_record_list = [int(i) for i in old_record_str.split(":")]
                        old_record_int = old_record_list[0] * 60 + old_record_list[1]

                    if old_record_str is None or old_record_int > end_time:
                        end_time_str = str(end_time)
                        print(f"{end_time_str = }")
                        self.rewrite_record_data(self.accessed_save, self.accessed_level, end_time_str)
                        is_new_record = True

                    self.ui_victory_screen.update_appearance(self.accessed_level, end_time, is_new_record)
                    self.ui_victory_screen.set_visibility()

                elif self.accessed_level == 3:
                    self.__timer += 10 * count_ert

        elif self.ui_sound.rect.collidepoint(_coords):
            self.ui_sound.mute()

        self.update_appearance()


