    def update_appearance(self, _time: float):
        # print(self.__queue, "LICKME")
        if self.__over:
            return

        else:
            _time = floor(_time)
            if _time >= 7 * len(self.__queue) + 28:  # Misal ada 4 elemen di queue; stop di detik ke-49
                print(f"[OVER] {len(self.__queue) = } {_time = }")
                self.set_invisible()
                self.__over = True
                return

        if _time % 14 == 7 and self.__invisible and self.__queue_pointer < len(self.__queue):
            self.set_visible()
            self.text.set_msg(self.__queue[self.__queue_pointer])
            self.text1.set_msg(self.__queue1[self.__queue_pointer])
            self.text2.set_msg(self.__queue2[self.__queue_pointer])
            self.text3.set_msg(self.__queue3[self.__queue_pointer])
            self.__queue_pointer += 1
            self.text.rerender()
            self.text1.rerender()
            self.text2.rerender()
            self.text3.rerender()

            # if pg.mixer and VOLUME is True:
            #     UIBubble.sounds["meow"][randint(0, len(UIBubble.sounds["meow"]) - 1)].play()

        elif _time % 14 == 0 and not self.__invisible:
            self.set_invisible()

    def set_invisible(self):
        self.__invisible = True
        self.image.set_alpha(0)
        self.text.image.set_alpha(0)
        self.text1.image.set_alpha(0)
        self.text2.image.set_alpha(0)
        self.text3.image.set_alpha(0)

    def set_visible(self):
        self.__invisible = False
        self.image.set_alpha(255)
        self.text.image.set_alpha(255)
        self.text1.image.set_alpha(255)
        self.text2.image.set_alpha(255)
        self.text3.image.set_alpha(255)


