class Text(pg.sprite.Sprite):
    font_style: Dict[str, None or Type[pg.font.Font]] = {
        "small": None,
        "normal": None,
        "big": None,
        "large": None,
        "clock": None
    }

    def __init__(self, _msg: str, _font: str, _x: int, _y: int, _color: tuple, _start_invis: bool, *groups):
        pg.sprite.Sprite.__init__(self, *groups)
        self.__msg = _msg
        self.__font = _font
        self.__x = _x
        self.__y = _y
        self.__color = _color

        self.rerender()
        self.image.set_alpha(0) if _start_invis else None
        self.rect = self.set_rect()

    def set_rect(self):
        return self.image.get_rect().move(self.__x, self.__y)

    def align(self, _enum: str):
        # https://stackoverflow.com/questions/25149892/how-to-get-the-width-of-text-using-pygame
        text_width, text_height = Text.font_style[self.__font].size(self.__msg)

        if _enum == "center":
            self.__x = (WIDTH - text_width) // 2
            self.rect = self.set_rect()

    def render(self):
        return Text.font_style[self.__font].render(self.__msg, True, self.__color)

    def rerender(self):
        self.image = self.render()

    def set_msg(self, _msg: str):
        self.__msg = _msg


