    group_opening = pg.sprite.RenderUpdates()
    group_title = pg.sprite.RenderUpdates()
    group_save = pg.sprite.RenderUpdates()
    group_map = pg.sprite.RenderUpdates()
    group_gameplay = pg.sprite.RenderUpdates()

    # Set the clock
    clock = pg.time.Clock()

    # Initialize our starting sprites and sprite container objects
    scene_opening = SceneOpening(group_opening)
    scene_title = SceneTitle(group_title)
    scene_save = SceneSave(group_save)
    scene_map = SceneMap(group_map)
    scene_gameplay = SceneGameplay(group_gameplay)

    # Run the main loop
    previous_group = group_opening
    current_group = group_opening
    scene = scene_opening
    str_scene = ""
    accessed_save = None
    accessed_level = None

    running = True
    do_once = True
    while running:
        # For CPU optimization
        ## https://www.pygame.org/docs/ref/time.html#pygame.time.wait
        ## https://pygame-users.seul.narkive.com/72cJeMuv/pygame-why-does-pygame-get-so-high-cpu-usage
        pg.time.wait(10)

        # Do something only once
        if do_once:
            scene.do_once()
        do_once = False

        # Listen for events
        ## https://www.pygame.org/docs/ref/event.html#pygame.event.wait
        ## Continue once no event has entered the queue in the last 50 milliseconds
        event = pg.event.wait(50)
        if event.type == pg.QUIT:
            # Exit the program
            # https://stackoverflow.com/a/19882744
            running = False
        elif event.type == pg.MOUSEBUTTONDOWN:
            mouse_coords = pg.mouse.get_pos()
            mouse_button = event.button
            click_output = scene.play_mouse_click(mouse_coords, mouse_button)
            if click_output is not None:  # happens when clicking on illegitimate target
                str_scene = click_output[0]
                accessed_save = click_output[1]
                accessed_level = click_output[2]

        # Clear/erase the last drawn sprites
        previous_group.clear(screen, background)
        current_group.clear(screen, background)

        # Update scene every tick
        ## https://stackoverflow.com/a/44035094/22699824
        dt = clock.tick(30) / 1000
        update_output = scene.update(dt)
        if update_output is not None and len(update_output) > 1 and update_output[0] == "transition":
            str_scene = update_output[1]
            accessed_save = update_output[2]
            accessed_level = update_output[3]

        # Update sprites
        current_group.update(dt)

        # Draw the scene
        ## https://www.pygame.org/docs/tut/newbieguide.html
        current_group.draw(screen)
        pg.display.flip()

        if str_scene != "":
            previous_group = current_group
            do_once = True
            if str_scene == "title":
                current_group = group_title
                scene = scene_title
            elif str_scene == "save":
                current_group = group_save
                scene = scene_save
            elif str_scene == "map":
                current_group = group_map
                scene = scene_map
                scene.accessed_save = accessed_save
            elif str_scene == "gameplay":
                current_group = group_gameplay
                scene = scene_gameplay
                scene.accessed_save = accessed_save
                scene.accessed_level = accessed_level
            str_scene = ""

    pg.quit()  # Might not be necessary?


if __name__ == "__main__":
    main()

