SLContext *context{nullptr};
SLTexture *tex{nullptr};
SLPrimitiveBuffer *geometry{nullptr};


int main(int argc, char *argv[])
{       
    int32 screen_w=800;
    int32 screen_h=600;
    bool fullscreen=false;
    int32 result=sl_create_context(&context,"simlib app",screen_w,screen_h,fullscreen);
    
    tex=new SLTexture("../src/bud.png",false);
    geometry=new SLPrimitiveBuffer;

    sl_disable_depthtest();
   

    do {
        sl_process_input(context);
        sl_ortho(context);
        sl_clrscr(context);


        // test drawing.
        sl_push_matrix();
        sl_disable_texturing();
        sl_disable_blending();
        sl_begin_triangles(geometry);
        sl_triangle(geometry,10,100,100,10,200,100,
            x11colours::red,x11colours::green,x11colours::blue);
        sl_end_triangles(geometry);
        sl_pop_matrix();

        sl_push_matrix();
        sl_enable_texturing();
        sl_bind_texture(geometry,tex);
        sl_begin_quads(geometry);
        sl_rectangle(geometry,512,200,128,128,x11colours::white);
        sl_end_quads(geometry);
        sl_unbind_texture(geometry);
        sl_pop_matrix();


        sl_swap(context);
        sl_poll_input(context);

    } while(!sl_want_to_quit(context));

    sl_destroy_context(&context);   
    delete tex;
    delete geometry;

    return 0;
}

import java.util.*;
public class ProductInformation {
public static void main(String[] args) {
Scanner scanner = new Scanner(System.in);
// Използваме LinkedHashMap да запазим продуктите по ред на въвеждане 
Map<String, Double> prices = new LinkedHashMap<>();
Map<String, Integer> quantities = new LinkedHashMap<>();
    String input = scanner.nextLine();
    while (!input.equals("buy")) {
        String[] tokens = input.split(" ");
        String productName = tokens[0];
        double price = Double.parseDouble(tokens[1]);
        int quantity = Integer.parseInt(tokens[2]);

        // Използваме  merge method за да ъпдейтнем цените и количествата 
        prices.merge(productName, price, (oldPrice, newPrice) -> newPrice);
        quantities.merge(productName, quantity, Integer::sum);

        input = scanner.nextLine();
    }

    // Ползваме  forEach loop за да принтираме общите цени на продуктите 
    prices.forEach((productName, price) -> {
        double totalPrice = price * quantities.get(productName);
        System.out.printf("%s -> %.2f%n", productName, totalPrice);
    });
}
}

        private async void triggerAnomaly_btn_Click(object sender, EventArgs e)
        {
            await Task.WhenAll(Transaction1(), Transaction2());
        }

        private async Task Transaction1()
        {
            using var connection = new SqlConnection(connectionString);
            await connection.OpenAsync();

            using var transaction = connection.BeginTransaction(IsolationLevel.ReadUncommitted);
            string currentName;
            int currentVersion;
            using (var command = new SqlCommand("SELECT first_name, version FROM Players WHERE player_id = 147", connection, transaction))
            {
                using var reader = await command.ExecuteReaderAsync();

                await reader.ReadAsync();
                currentName = reader.GetString(0);
                currentVersion = reader.GetInt32(1);
                logger.Log($"Transaction1 reads: {currentName}, version = {currentVersion}");

                await reader.CloseAsync();
            }

            // Змінюємо first_name
            using (var command = new SqlCommand("UPDATE Players SET first_name = @first_name, version = @new_version WHERE player_id = 147 AND version = @version", connection, transaction))
            {
                command.Parameters.AddWithValue("@first_name", currentName + "1");
                command.Parameters.AddWithValue("@new_version", currentVersion + 1);
                command.Parameters.AddWithValue("@version", currentVersion);
                await command.ExecuteNonQueryAsync();
            }

            // Виводимо проміжний результат
            using (var command = new SqlCommand("SELECT first_name, version FROM Players WHERE player_id = 147", connection, transaction))
            {
                using var reader = await command.ExecuteReaderAsync();

                await reader.ReadAsync();
                currentName = reader.GetString(0);
                currentVersion = reader.GetInt32(1);
                logger.Log($"Transaction1 reads: {currentName}, version = {currentVersion}");

                await reader.CloseAsync();
            }

            // Затримка перед завершенням транзакції
            await Task.Delay(1000);

            await transaction.CommitAsync();
            logger.Log("Transaction 1 completed");
        }

        private async Task Transaction2()
        {
            int totalAttempts = 3;
            for (int attempt = 0; attempt < totalAttempts; attempt++)
            {
                using var connection = new SqlConnection(connectionString);
                await connection.OpenAsync();

                using var transaction = connection.BeginTransaction(IsolationLevel.ReadUncommitted);
                try
                {
                    string currentName;
                    int currentVersion;
                    using (var command = new SqlCommand("SELECT first_name, version FROM Players WHERE player_id = 147", connection, transaction))
                    {
                        using var reader = await command.ExecuteReaderAsync();

                        await reader.ReadAsync();
                        currentName = reader.GetString(0);
                        currentVersion = reader.GetInt32(1);
                        logger.Log($"Transaction2 reads: {currentName}, version = {currentVersion}");

                        await reader.CloseAsync();
                    }

                    await Task.Delay(500);

                    // Змінюємо first_name
                    using (var command = new SqlCommand("UPDATE Players SET first_name = @first_name, version = @new_version WHERE player_id = 147 AND version = @version", connection, transaction))
                    {
                        command.Parameters.AddWithValue("@first_name", currentName + "2");
                        command.Parameters.AddWithValue("@new_version", currentVersion + 1);
                        command.Parameters.AddWithValue("@version", currentVersion);

                        if (await command.ExecuteNonQueryAsync() == 0)
                        {
                            throw new Exception("The name was updated by another transaction");
                        }
                    }

                    using (var command = new SqlCommand("SELECT first_name, version FROM Players WHERE player_id = 147", connection, transaction))
                    {
                        using var reader = await command.ExecuteReaderAsync();

                        await reader.ReadAsync();
                        currentName = reader.GetString(0);
                        currentVersion = reader.GetInt32(1);
                        logger.Log($"Transaction2 reads: {currentName}, version = {currentVersion}");

                        await reader.CloseAsync();
                    }

                    logger.Log("Transaction 2 completed");
                    await transaction.CommitAsync();
                    break;
                }
                catch (Exception ex)
                {
                    logger.Log($"Transaction 2: Error - {ex.Message}");
                    await transaction.RollbackAsync();
                    //task delay
                }
            }
        }

